import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './index.css';
import Sdata from './Sdata';

// console.log(Sdata[0].sname);

ReactDOM.render(
  <>
  <h1 className='heading_style'>List Of Top 5 Netflix Series in 2023</h1>
    <Card
      imgsrc={Sdata[0].imgscr}
      title = {Sdata[0].title}
      sname={Sdata[0].sname}
      link={Sdata[0].link}
    />

    <Card 
      imgsrc={Sdata[1].imgscr}
      title = {Sdata[1].title}
      sname={Sdata[1].sname}
      link={Sdata[1].link}
    />

    <Card
      imgsrc={Sdata[1].imgscr}
      title = {Sdata[1].title}
      sname={Sdata[1].sname}
      link={Sdata[1].link}
    />

    <Card
      imgsrc={Sdata[0].imgscr}
      title = {Sdata[0].title}
      sname={Sdata[0].sname}
      link={Sdata[0].link}
    />

    <Card
      imgsrc={Sdata[0].imgscr}
      title = {Sdata[0].title}
      sname={Sdata[0].sname}
      link={Sdata[0].link}
    />
  </>,
  document.getElementById('root')
);
